import poster1_img from './poster1.png'
import poster2_img from './poster2.png'
import poster3_img from './poster2.png'

let poster = [
    {
      id:1,
      name:"無效收容",
      image:poster1_img,
      url: "https://haqingmu.weebly.com/uploads/1/4/5/2/145297839/published/eiden3.png?1711256394"
    },
    {id:2,
      name:"裸",
      image:poster2_img,
      url: "https://haqingmu.weebly.com/uploads/1/4/5/2/145297839/published/eiden3.png?1711256394"
    },
    {id:3,
      name:"囚籠",
      image:poster3_img,
      url: "https://haqingmu.weebly.com/uploads/1/4/5/2/145297839/published/eiden3.png?1711256394"
    },
  ];

export default poster;
